import { MOVIES } from "../constants/index";

const MoviesReducer = (state = ["hello"], action) => {
  switch (action.type) {
    case MOVIES.FETCH:
      console.log("fetch movies");
      return [...state, ...action.movies];
    default:
      return state;
  }
};

export default MoviesReducer;
